export class User {
  constructor(email, id, _token, _tokenExpDate) {
    this.email = email;
    this.id = id;
    this._token = _token;
    this._tokenExpDate = _tokenExpDate;
  }

  get token() {
    if (this._tokenExpDate && new Date() > this._tokenExpDate) return null;
    return this._token;
  }

  get tokenExpDate() {
    return this._tokenExpDate;
  }

}
